getWeb3 = async () => {
  try {
    let currentProvider = null;
    if (window.ethereum) {
      await window.ethereum.enable();
      currentProvider = window.ethereum;
    } else if (window.web3) {
      currentProvider = window.web3.currentProvider;
    } else {
      alert('No Metamask (or other Web3 Provider) installed');
    }
    if (currentProvider) {
      const web3 = new Web3(currentProvider);
      const networkId = await web3.eth.net.getId();
      const accounts = (await web3.eth.getAccounts()) || web3.eth.accounts;
      const account = accounts[0];
      return {web3, account, networkId}
    }
  } catch (err) {
    console.log(err);
  }
};

mint = async () => {
  try {
    let { web3, account, networkId } = await getWeb3();
    if (networkId != 1) {
      alert('Please connect to the mainnet');
      return
    }
    const contract = new web3.eth.Contract(abi, address);
    const tx = await contract.methods.mint().send({from: account});
    console.log(tx);
  } catch (err) {
    console.log(err.message);
  }
}

tokenURI = async () => {
  try {
    let { web3, account, networkId } = await getWeb3();
    if (networkId != 1) {
      alert('Please connect to the mainnet');
      return
    }
    const contract = new web3.eth.Contract(abi, address);
    const tokenId = document.getElementById('tokenid').value;
    const tokenURI = await contract.methods.tokenURI(tokenId).call();
    document.getElementById('tokenuri-value').value = tokenURI;
    const json = JSON.parse(atob(tokenURI.replace('data:application/json;base64,', '')));
    document.getElementById('tokenuri-image').src = json.image;
  } catch (err) {
    document.getElementById('tokenuri-value').value = err.message;
    document.getElementById('tokenuri-image').src = './img/svg/error.svg';
  }
}

